package com.example.demo;

public class Shopalloc_post {
private int N_id;
private int A_id;
private int T_id;
private int D_id;
private int B_id;
private int M_id;
public Shopalloc_post() {
	super();
	// TODO Auto-generated constructor stub
}
public Shopalloc_post(int n_id, int a_id, int t_id, int d_id, int b_id, int m_id) {
	super();
	N_id = n_id;
	A_id = a_id;
	T_id = t_id;
	D_id = d_id;
	B_id = b_id;
	M_id = m_id;
}
public int getN_id() {
	return N_id;
}
public void setN_id(int n_id) {
	N_id = n_id;
}
public int getA_id() {
	return A_id;
}
public void setA_id(int a_id) {
	A_id = a_id;
}
public int getT_id() {
	return T_id;
}
public void setT_id(int t_id) {
	T_id = t_id;
}
public int getD_id() {
	return D_id;
}
public void setD_id(int d_id) {
	D_id = d_id;
}
public int getB_id() {
	return B_id;
}
public void setB_id(int b_id) {
	B_id = b_id;
}
public int getM_id() {
	return M_id;
}
public void setM_id(int m_id) {
	M_id = m_id;
}
@Override
public String toString() {
	return "Shopalloc_post [N_id=" + N_id + ", A_id=" + A_id + ", T_id=" + T_id + ", D_id=" + D_id + ", B_id=" + B_id
			+ ", M_id=" + M_id + "]";
}



}
